
const paragraphs = document.getElementsByTagName('p');

var waldoImg;

var seconds = 0;
var tens = 0;
var interval;

interval = setInterval(() => {
    tens++;
    
    if (tens > 99) {
      seconds++;
      tens = 0;
    }
}, 10);

if (paragraphs && paragraphs.length > 0) {
    const rpn = Math.floor(Math.random() * paragraphs.length);

    waldoImg = document.createElement('img');
    waldoImg.src = "data:image/png;base64,"
    waldoImg.style.height = "10px";
    waldoImg.style.width = "10px";
    waldoImg.style.display = "inline";

    paragraphs[rpn].insertAdjacentElement("afterend", waldoImg);
}

waldoImg.addEventListener('click', () => {
    if (interval) {
        clearInterval(interval)
    }
    alert(`Took you ${seconds || 0}.${tens || 0} seconds`);
})